leadingComments.value:
*
 * class Tensor is the primitive class for composing higher tensor based class.
 * This class wrap [tensorflowjs](https://www.tensorflow.org/js) for providing tensor calculation
 * @class Tensor
 * @example
 * import { Tensor, causalNetCore } from 'causal-net.core';
 * let tensor = new Tensor();
 * let T = causalNetCore.CoreTensor;
 * let ta = T.tensor([1, 2]);
 * console.log(tensor.isTensor(ta));
 * console.log(tensor.isTensor([1,2,3]));

